import React from 'react';

const Footer = () => {
  return (
    <footer className="footer mt-auto py-3">
      <div className="container text-center">
        <span className="text-muted" style={{ color: 'white' }}>&copy; 2024 BTC Tracker. All rights reserved.</span>
      </div>
    </footer>
  );
};

export default Footer;
